BundleDataSourceAsyncWaiter::BundleDataSourceAsyncWaiter(BundleDataSource* proxy)
    : proxy_(proxy)
{
}

BundleDataSourceAsyncWaiter::~BundleDataSourceAsyncWaiter() = default;

void BundleDataSourceAsyncWaiter::Read(uint64_t offset, uint64_t length, std::optional<std::vector<uint8_t>>* out_buffer)
{
    base::RunLoop loop;
    proxy_->Read(std::move(offset), std::move(length),
        base::BindOnce(
            [](base::RunLoop* loop, std::optional<std::vector<uint8_t>>* out_buffer, const std::optional<std::vector<uint8_t>>& buffer) {
                *out_buffer = std::move(buffer);
                loop->Quit();
            },
            &loop, out_buffer));
    loop.Run();
}

std::optional<std::vector<uint8_t>> BundleDataSourceAsyncWaiter::Read(uint64_t offset, uint64_t length)
{
    std::optional<std::vector<uint8_t>> async_wait_result;
    Read(std::move(offset), std::move(length), &async_wait_result);
    return async_wait_result;
}

void BundleDataSourceAsyncWaiter::Length(int64_t* out_length)
{
    base::RunLoop loop;
    proxy_->Length(base::BindOnce(
        [](base::RunLoop* loop, int64_t* out_length, int64_t length) {
            *out_length = std::move(length);
            loop->Quit();
        },
        &loop, out_length));
    loop.Run();
}

int64_t BundleDataSourceAsyncWaiter::Length()
{
    int64_t async_wait_result;
    Length(&async_wait_result);
    return async_wait_result;
}

void BundleDataSourceAsyncWaiter::IsRandomAccessContext(bool* out_is_random_access)
{
    base::RunLoop loop;
    proxy_->IsRandomAccessContext(base::BindOnce(
        [](base::RunLoop* loop, bool* out_is_random_access, bool is_random_access) {
            *out_is_random_access = std::move(is_random_access);
            loop->Quit();
        },
        &loop, out_is_random_access));
    loop.Run();
}

bool BundleDataSourceAsyncWaiter::IsRandomAccessContext()
{
    bool async_wait_result;
    IsRandomAccessContext(&async_wait_result);
    return async_wait_result;
}

void BundleDataSourceAsyncWaiter::Close()
{
    base::RunLoop loop;
    proxy_->Close(base::BindOnce([](base::RunLoop* loop) { loop->Quit(); }, &loop));
    loop.Run();
}

